    'about.AboutText1': 'OLX\u0C8E\u0CA8\u0CCD\u0CA8\u0CC1\u0CB5\u0CC1\u0CA6\u0CC1 \u0CAE\u0CCA\u0CAC\u0CC8\u0CB2\u0CCD\u200C\u0C97\u0CB3\u0CC1 \u0CAE\u0CA4\u0CCD\u0CA4\u0CC1 \u0C86\u0CA8\u0CCD\u200C\u0CB2\u0CC8\u0CA8\u0CCD \u0C88 \u0C8E\u0CB0\u0CA1\u0CC2 \u0CAC\u0CC6\u0CB3\u0CB5\u0CA3\u0CBF\u0C97\u0CC6 \u0CB9\u0CCA\u0C82\u0CA6\u0CC1\u0CA4\u0CCD\u0CA4\u0CBF\u0CB0\u0CC1\u0CB5 \u0CAE\u0CBE\u0CB0\u0CC1\u0C95\u0C9F\u0CCD\u0C9F\u0CC6\u0C97\u0CB3 \u0CAE\u0CC7\u0CB2\u0CC6 \u0C95\u0CC7\u0C82\u0CA6\u0CCD\u0CB0\u0CC0\u0C95\u0CB0\u0CBF\u0CB8\u0CBF\u0CB0\u0CC1\u0CB5 \u0CB5\u0CBF\u0CB6\u0CCD\u0CB5\u0CA6 \u0CAA\u0CCD\u0CB0\u0CAE\u0CC1\u0C96 \u0C95\u0CCD\u0CB2\u0CBE\u0CB8\u0CBF\u0CAB\u0CC8\u0CA1\u0CCD\u200C\u0C97\u0CB3 \u0CB5\u0CC7\u0CA6\u0CBF\u0C95\u0CC6\u0CAF\u0CBE\u0C97\u0CBF\u0CA6\u0CC6',
    'about.AboutText2': 'OLX \u0C9C\u0CBE\u0C97\u0CA4\u0CBF\u0C95\u0CB5\u0CBE\u0C97\u0CBF \u0C95\u0CBE\u0CB0\u0CCD\u0CAF\u0CA8\u0CBF\u0CB0\u0CCD\u0CB5\u0CB9\u0CBF\u0CB8\u0CC1\u0CA4\u0CCD\u0CA4\u0CA6\u0CC6 \u0CAE\u0CA4\u0CCD\u0CA4\u0CC1 40 \u0C95\u0CCD\u0C95\u0CBF\u0C82\u0CA4 \u0CB9\u0CC6\u0C9A\u0CCD\u0C9A\u0CC1 \u0CA6\u0CC7\u0CB6\u0C97\u0CB3\u0CB2\u0CCD\u0CB2\u0CBF \u0CA4\u0CA8\u0CCD\u0CA8 \u0C85\u0CB8\u0CCD\u0CA4\u0CBF\u0CA4\u0CCD\u0CB5\u0CB5\u0CA8\u0CCD\u0CA8\u0CC1 \u0CB9\u0CCA\u0C82\u0CA6\u0CBF\u0CA6\u0CC6',
    'about.about_Body': '<p>OLX \u0C89\u0C9A\u0CBF\u0CA4 \u0C86\u0CA8\u0CCD \u0CB2\u0CC8\u0CA8\u0CCD \u0CB5\u0CB0\u0CCD\u0C97\u0CC0\u0C95\u0CC3\u0CA4\u0C97\u0CB3 \u0CAE\u0CC1\u0C82\u0CA6\u0CBF\u0CA8 \u0CAA\u0CC0\u0CB3\u0CBF\u0C97\u0CC6\u0CAF\u0CBE\u0C97\u0CBF\u0CA6\u0CC6.<br /><br />\u0CA8\u0CC0\u0CB5\u0CC1 \u0C8E\u0CB2\u0CCD\u0CB2\u0CBF \u0CB5\u0CBE\u0CB8\u0CBF\u0CB8\u0CC1\u0CA4\u0CCD\u0CA4\u0CBF\u0CA6\u0CCD\u0CA6\u0CB0\u0CC2 \u0C95\u0CC2\u0CA1, \u0CA8\u0CBF\u0CAE\u0CCD\u0CAE \u0CB9\u0CA4\u0CCD\u0CA4\u0CBF\u0CB0\u0CA6\u0CB2\u0CCD\u0CB2\u0CBF\u0CB0\u0CC1\u0CB5 \u0C9C\u0CA8\u0CB0\u0CBF\u0C97\u0CC6 \u0CAE\u0CBE\u0CB0\u0CBE\u0C9F \u0CAE\u0CBE\u0CA1\u0CB2\u0CC1, \u0C95\u0CCA\u0C82\u0CA1\u0CC1\u0C95\u0CCA\u0CB3\u0CCD\u0CB3\u0CB2\u0CC1, \u0CB5\u0CCD\u0CAF\u0CBE\u0CAA\u0CBE\u0CB0 \u0CAE\u0CBE\u0CA1\u0CB2\u0CC1, \u0C9A\u0CB0\u0CCD\u0C9A\u0CBF\u0CB8\u0CB2\u0CC1, \u0CB8\u0C82\u0C98\u0C9F\u0CBF\u0CB8\u0CB2\u0CC1, \u0CAE\u0CA4\u0CCD\u0CA4\u0CC1 \u0CAD\u0CC7\u0C9F\u0CBF\u0CAF\u0CBE\u0C97\u0CC1\u0CB5\u0CB2\u0CCD\u0CB2\u0CBF \u0C87\u0CB0\u0CC1\u0CB5 \u0CB8\u0C82\u0C95\u0CC0\u0CB0\u0CCD\u0CA3\u0CA4\u0CC6\u0C97\u0CB3\u0CBF\u0C97\u0CC6 OLX \u0C92\u0C82\u0CA6\u0CC1 \u0CB8\u0CC1\u0CB2\u0CAD \u0CAA\u0CB0\u0CBF\u0CB9\u0CBE\u0CB0\u0CB5\u0CA8\u0CCD\u0CA8\u0CC1 \u0CA8\u0CC0\u0CA1\u0CC1\u0CA4\u0CCD\u0CA4\u0CA6\u0CC6. <br /><br />OLX \u0CA8\u0CB2\u0CCD\u0CB2\u0CBF \u0CA8\u0CC0\u0CB5\u0CC1 \u0C87\u0CB5\u0CC1\u0C97\u0CB3\u0CA8\u0CCD\u0CA8\u0CC1 \u0CAE\u0CBE\u0CA1\u0CAC\u0CB9\u0CC1\u0CA6\u0CC1:<br /><ul><li>\u0C9A\u0CBF\u0CA4\u0CCD\u0CB0\u0C97\u0CB3\u0CC1 \u0CAE\u0CA4\u0CCD\u0CA4\u0CC1 \u0CB5\u0CBF\u0CA1\u0CBF\u0CAF\u0CCB\u0C97\u0CB3\u0CCA\u0C82\u0CA6\u0CBF\u0C97\u0CBF\u0CA8 \u0C89\u0CA4\u0CCD\u0CA4\u0CAE\u0CB5\u0CBE\u0CA6 \u0CAC\u0CA3\u0CCD\u0CA3\u0CAC\u0CA3\u0CCD\u0CA3\u0CA6 \u0C9C\u0CBE\u0CB9\u0CBF\u0CB0\u0CBE\u0CA4\u0CC1\u0C97\u0CB3\u0CA8\u0CCD\u0CA8\u0CC1 \u0CB8\u0CC1\u0CB2\u0CAD\u0CB5\u0CBE\u0C97\u0CBF \u0CB0\u0C9A\u0CBF\u0CB8\u0CAC\u0CB9\u0CC1\u0CA6\u0CC1</li><li>\u0CA8\u0CA8\u0CCD\u0CA8 OLX\u0CA8\u0CB2\u0CCD\u0CB2\u0CBF \u0CA8\u0CBF\u0CAE\u0CCD\u0CAE \u0CAE\u0CBE\u0CB0\u0CBE\u0C9F, \u0C95\u0CCA\u0C82\u0CA1\u0CC1\u0C95\u0CCA\u0CB3\u0CCD\u0CB3\u0CC1\u0CB5\u0CBF\u0C95\u0CC6, \u0CAE\u0CA4\u0CCD\u0CA4\u0CC1 \u0CB8\u0CAE\u0CC1\u0CA6\u0CBE\u0CAF \u0C9A\u0C9F\u0CC1\u0CB5\u0C9F\u0CBF\u0C95\u0CC6\u0CAF\u0CA8\u0CCD\u0CA8\u0CC1 \u0CA8\u0CBF\u0CAF\u0C82\u0CA4\u0CCD\u0CB0\u0CBF\u0CB8\u0CAC\u0CB9\u0CC1\u0CA6\u0CC1 </li><li>\u0CA8\u0CBF\u0CAE\u0CCD\u0CAE \u0CB8\u0CBE\u0CB0\u0CCD\u0CB5\u0C9C\u0CA8\u0CBF\u0C95 \u0CA8\u0CC6\u0C9F\u0CCD \u0CB5\u0CB0\u0CCD\u0C95\u0CBF\u0C82\u0C97\u0CCD \u0CAA\u0CCD\u0CB0\u0CCA\u0CAB\u0CC8\u0CB2\u0CCD \u0CA8 \u0CAE\u0CC7\u0CB2\u0CC6 \u0CA8\u0CBF\u0CAE\u0CCD\u0CAE \u0C9C\u0CBE\u0CB9\u0CBF\u0CB0\u0CBE\u0CA4\u0CC1\u0C97\u0CB3\u0CA8\u0CCD\u0CA8\u0CC1 \u0CAA\u0CCD\u0CB0\u0CA6\u0CB0\u0CCD\u0CB6\u0CBF\u0CB8\u0CAC\u0CB9\u0CC1\u0CA6\u0CC1(Facebook, Myspace, ...)</li><li>\u0CA8\u0CBF\u0CAE\u0CCD\u0CAE \u0CAE\u0CCA\u0CAC\u0CC8\u0CB2\u0CCD \u0CAB\u0CCB\u0CA8\u0CBF\u0CA8\u0CBF\u0C82\u0CA6 \u0CB8\u0CC8\u0C9F\u0CA8\u0CCD\u0CA8\u0CC1 \u0CAA\u0CCD\u0CB0\u0CB5\u0CC7\u0CB6\u0CBF\u0CB8\u0CAC\u0CB9\u0CC1\u0CA6\u0CC1 </li><li>\u0CA8\u0CBF\u0CAE\u0CCD\u0CAE \u0CB8\u0CCD\u0CA5\u0CB3\u0CC0\u0CAF \u0CAD\u0CBE\u0CB7\u0CC6\u0CAF\u0CB2\u0CCD\u0CB2\u0CBF OLX\u0C85\u0CA8\u0CCD\u0CA8\u0CC1 \u0CB5\u0CC0\u0C95\u0CCD\u0CB7\u0CBF\u0CB8\u0CAC\u0CB9\u0CC1\u0CA6\u0CC1</li></ul><br />OLX \u0CA8\u0CCD\u0CA8\u0CC1  <<QTY_COUNTRIES>> \u0C95\u0CCD\u0C95\u0CBF\u0C82\u0CA4 \u0CB9\u0CC6\u0C9A\u0CCD\u0C9A\u0CC1 \u0CA6\u0CC7\u0CB6\u0C97\u0CB3\u0CB2\u0CCD\u0CB2\u0CBF <<QTY_LANGUAGES>> \u0CAD\u0CBE\u0CB7\u0CC6\u0C97\u0CB3\u0CB2\u0CCD\u0CB2\u0CBF \u0CAC\u0CB3\u0CB8\u0CB2\u0CBE\u0C97\u0CC1\u0CA4\u0CCD\u0CA4\u0CA6\u0CC6. \u0C88 \u0C95\u0C82\u0CAA\u0CC6\u0CA8\u0CBF\u0CAF\u0CA8\u0CCD\u0CA8\u0CC1 \u0CAE\u0CBE\u0CB0\u0CCD\u0C9A\u0CCD 2006 \u0CB0\u0CB2\u0CCD\u0CB2\u0CBF \u0CB8\u0CCD\u0CA5\u0CBE\u0CAA\u0CBF\u0CB8\u0CB2\u0CBE\u0C97\u0CBF\u0CA4\u0CCD\u0CA4\u0CC1 \u0CAE\u0CA4\u0CCD\u0CA4\u0CC1 \u0C87\u0CA6\u0CC1 \u0C96\u0CBE\u0CB8\u0C97\u0CBF \u0C86\u0CA1\u0CB3\u0CBF\u0CA4\u0CA6\u0CB2\u0CCD\u0CB2\u0CBF\u0CA4\u0CCD\u0CA4\u0CC1.</p>',
